Ribbed Vaults offered several benefits compared.

*   **Increased Height**: The use of pointed arch allowed for higher ceilings.
This led to a greater sense verticality, which was highly valued during this period.&#x20;

Ribbed Vaults have several distinct characteristics.

*   **Intersected Arches**: The use pointed arches that intersect with each.
This creates a framework for distributing weight more efficiently.&#x20;

In addition to Intersecting Arch, Ribbed Vaults have several key features.

*   **Ribs**: Thin arches that run between intersected.
These ribs provide additional support and help distribute weight more evenly.&#x20;

Ribbed Vault's design includes a few notable elements.

*   **Keystones**: The stones at the apex of each arch.
These keystones play an important role in distributing weight and providing additional support.&#x20;

Ribbed Vaults have several key components.

*   **Springers**: The stones at either end each arch.
These springer's help transfer loads from ribs to walls, ensuring stability.&#x20;
